import React from 'react'
import AddProject from '../components/AddProject/AddProject'

const Projects = () => {
  const [projects , setProjects] = useState([])
  return (
    <div>
       <h2>Projects</h2>
       <AddProject/>

       {projects.length === 0? 
       <div><h2>No Record</h2></div> 
        : 
         projects.map(project => ( <div> {project} </div>))}
    </div>
  )
}

export default Projects
